import React, { useState, useEffect } from 'react';
import axios from 'axios';
import EventImpact from './EventImpact';

function Dashboard() {
  const [events, setEvents] = useState([]);
  const [prices, setPrices] = useState([]);
  const [selectedEventId, setSelectedEventId] = useState(null);
  const [eventData, setEventData] = useState([]);
  const [changePoint, setChangePoint] = useState(null);
  const [activeTab, setActiveTab] = useState("price"); // 🔑 Active output

  useEffect(() => {
    axios.get('http://localhost:5000/api/prices')
      .then(res => setPrices(res.data))
      .catch(console.error);

    axios.get('http://localhost:5000/api/events')
      .then(res => setEvents(res.data))
      .catch(console.error);

    axios.get('http://localhost:5000/api/change-point')
      .then(res => setChangePoint(res.data))
      .catch(console.error);
  }, []);

  useEffect(() => {
    if (selectedEventId !== null) {
      axios.get(`http://localhost:5000/api/event-impact/${selectedEventId}`)
        .then(res => setEventData(res.data))
        .catch(console.error);
    }
  }, [selectedEventId]);

  const renderContent = () => {
    switch (activeTab) {
      case "price":
        return (
          <EventImpact
            allData={prices}
            eventData={eventData}
            eventMeta={events[selectedEventId]}
            changePoint={changePoint}
          />
        );
      case "volatility":
        return <p>📉 Volatility chart (coming soon)</p>;
      case "changepoint":
        return (
          <p>🔁 Most Probable Change Point: <strong>{changePoint?.date}</strong></p>
        );
      case "eventsummary":
        return selectedEventId !== null ? (
          <div>
            <h3>📋 Event Summary</h3>
            <p><strong>Event:</strong> {events[selectedEventId].Event}</p>
            <p><strong>Date:</strong> {events[selectedEventId].StartDate}</p>
            <p><strong>Description:</strong> {events[selectedEventId].Description}</p>
            <p><strong>Category:</strong> {events[selectedEventId].Category}</p>
          </div>
        ) : (
          <p>Select an event from the dropdown to view details.</p>
        );
      default:
        return <p>Select a tab.</p>;
    }
  };

  return (
    <div style={{ padding: '20px' }}>
      <h2>📊 Brent Oil Price Dashboard</h2>

      {/* 🔘 Button Group */}
      <div style={{ marginBottom: '20px' }}>
        {["price", "volatility", "changepoint", "eventsummary"].map((tab) => (
          <button
            key={tab}
            onClick={() => setActiveTab(tab)}
            style={{
              padding: '10px 15px',
              marginRight: '10px',
              backgroundColor: activeTab === tab ? "#1976d2" : "#e0e0e0",
              color: activeTab === tab ? "#fff" : "#000",
              border: 'none',
              borderRadius: '5px',
              cursor: 'pointer',
              fontWeight: 'bold',
            }}
          >
            {tab === "price" && "📈 Price Chart"}
            {tab === "volatility" && "📉 Volatility"}
            {tab === "changepoint" && "🔁 Change Point"}
            {tab === "eventsummary" && "📋 Event Summary"}
          </button>
        ))}
      </div>

      {/* 🧩 Event Selector */}
      <div style={{ marginBottom: '15px' }}>
        <label>Select Event: </label>
        <select
          onChange={(e) => setSelectedEventId(e.target.value)}
          defaultValue=""
        >
          <option value="" disabled>Select an event</option>
          {events.map((ev, index) => (
            <option key={index} value={index}>
              {ev.Event} ({ev.Category})
            </option>
          ))}
        </select>
      </div>

      {/* 👇 Dynamic Content */}
      {renderContent()}
    </div>
  );
}

export default Dashboard;
